import logo from '../assets/images/logo-01-01.png';
import '../App.css';
import React from 'react';
import { Link } from 'react-router-dom';

export default function Navigation({ isLoggedIn, handleLogout }) {
    return (
        <div className="nav">
            <nav>
                <ul className="nav-list">
                    <li className="nav-list--logo"><Link to='/'><img src={logo} className="App-logo" alt="logo" /></Link></li>
                    <li className="nav-list--element"><Link to='/Banner'>Banner</Link></li>
                    <li className="nav-list--element nav-list--element-right"><Link to='/Booking'>Booking</Link></li>
                    <li className="nav-list--element"><Link to='/Doctor'>Doctor</Link></li>
                    <li className="nav-list--element"><Link to='/crDoc'>crDoc</Link></li>
                    <li className="nav-list--element"><Link to='/Worksheet'>View Worksheet</Link></li>
                </ul>

                {isLoggedIn ? (
                    <div className="nav-list--prior">
                        <button onClick={handleLogout}>Logout</button>
                    </div>
                ) : (
                    <div className="nav-list--prior">
                        <Link to='/Login'>Login</Link>
                    </div>
                )}

            </nav>
        </div>
    );
}
